export default function Candidate(props) {
    async function approveCandidate() {
        try {
            let approval = await props.contract.approveCandidate(props.index);
            await approval.wait();
            console.log(approval);
        } catch (error) {
            console.log(error);
        }
    }
    return (
        <div>
            <p>Candidate {props.index}</p>
            <p>Candidate name : {props.candidate.name}</p>
            <p>Candidate symbol : {props.candidate.symbol}</p>
            <button id={props.index} onClick={approveCandidate}>Approve</button>
        </div>
    )
}
